/*
 * 1203. Sort Items by Groups Respecting Dependencies
 * https://leetcode.com/problems/sort-items-by-groups-respecting-dependencies/
 */

#include <iostream>
#include <vector>
#include <unordered_set>

#include "helpers/Operators.hpp"
#include "helpers/terminal_format.h"


#pragma mark - 1. 2-level topological sort: DFS + BFS
// Time Limit Exceeded
class Solution {
private:
    static constexpr int UNVISITED_FLAG = 0;
    static constexpr int BEING_VISITED_FLAG = 1;
    static constexpr int VISITED_FLAG = 2;

#pragma mark Topological sort
private:
    bool groupDfs(const std::vector<std::unordered_set<int>>& groupGraph, std::vector<int>& returnValue, std::vector<int>& visited, const int currentGroup) {
        if (visited[currentGroup] == VISITED_FLAG) {
            return true;
        } else if (visited[currentGroup] == BEING_VISITED_FLAG) {
            return false;
        }

        visited[currentGroup] = BEING_VISITED_FLAG;

        // Visit all children.
        for (const int& child: groupGraph[currentGroup]) {
            bool childResult = groupDfs(groupGraph, returnValue, visited, child);
            if (!childResult) {
                return false;
            }
        }

        visited[currentGroup] = VISITED_FLAG;
        returnValue.push_back(currentGroup);

        return true;
    }

public:
    std::vector<int> sortItems(const int itemCount, const int groupCount, const std::vector<int>& group, const std::vector<std::vector<int>>& beforeItems) {
        // 1. Create graphs.
        /// (parent, children)
        auto itemGraph = std::vector<std::unordered_set<int>>(itemCount, std::unordered_set<int>());
        /// (parent, children)
        auto groupGraph = std::vector<std::unordered_set<int>>(groupCount, std::unordered_set<int>());

        for (int i = 0; i < itemCount; i += 1) {
            const auto& currentBeforeItems = beforeItems[i];
            if (currentBeforeItems.empty()) {
                continue;
            }

            for (const int& beforeItem: currentBeforeItems) {
                itemGraph[beforeItem].insert(i);

                const int beforeGroup = group[beforeItem];
                const int currentGroup = group[i];
                if ((beforeGroup != currentGroup) && (beforeGroup != -1) && (currentGroup != -1)) {
                    groupGraph[beforeGroup].insert(currentGroup);
                }
            }
        }

        // 2. Generate a valid group order.
        auto groupOrder = std::vector<int>();
        groupOrder.reserve(groupCount);

        auto groupVisited = std::vector<int>(groupCount, UNVISITED_FLAG);

        for (int g = 0; g < groupCount; g += 1) {
            const bool groupResult = groupDfs(groupGraph, groupOrder, groupVisited, g);
            if (!groupResult) {
                // Cycle in group dependency.
                return {};
            }
        }

        std::reverse(groupOrder.begin(), groupOrder.end());    // Need to reverse DFS result.

        // 3. Generate a valid item order (should use BFS, DFS doesn't work).
        auto inDegrees = std::vector<int>(itemCount, 0);
        for (int i = 0; i < itemCount; i += 1) {
            for (const int& child: itemGraph[i]) {
                inDegrees[child] += 1;
            }
        }

        auto itemOrder = std::vector<int>();
        itemOrder.reserve(itemCount);

        // Visit items according to group order.
        for (const int& g: groupOrder) {
            // 1st pass: Items with no group and 0 in-degree.
            for (int i = 0; i < itemCount; i += 1) {
                if ((group[i] == -1) && (inDegrees[i] == 0)) {
                    itemOrder.push_back(i);

                    inDegrees[i] = -1;

                    const auto& children = itemGraph[i];
                    for (const int& child: children) {
                        inDegrees[child] -= 1;
                    }
                }
            }

            // 2nd pass: All items in the current group.
            auto currentGroupItems = std::vector<int>();
            for (int i = 0; i < itemCount; i += 1) {
                if (group[i] == g) {
                    currentGroupItems.push_back(i);
                }
            }

            while (!currentGroupItems.empty()) {
                auto newCurrentGroupItems = std::vector<int>();

                for (auto i: currentGroupItems) {
                    if (inDegrees[i] == 0) {
                        itemOrder.push_back(i);

                        inDegrees[i] = -1;

                        const auto& children = itemGraph[i];
                        for (const int& child: children) {
                            inDegrees[child] -= 1;
                        }
                    } else {
                        newCurrentGroupItems.push_back(i);
                    }
                }

                if (newCurrentGroupItems.size() == currentGroupItems.size()) {
                    // Has cycle.
                    return {};
                }

                currentGroupItems = newCurrentGroupItems;
            }
        }

        // Finally, visit the remaining "dangling" items (without a group or item dependency)
        bool hasPositiveDegree = true;

        while (hasPositiveDegree) {
            hasPositiveDegree = false;

            for (int i = 0; i < itemCount; i += 1) {
                if (inDegrees[i] == 0) {
                    itemOrder.push_back(i);

                    inDegrees[i] = -1;

                    const auto& children = itemGraph[i];
                    for (const int& child: children) {
                        inDegrees[child] -= 1;
                    }
                } else if (inDegrees[i] > 0) {
                    hasPositiveDegree = true;
                }
            }
        }

        return itemOrder;
    }
};


#pragma mark - 2
/*
 * Maybe let's introduce some temporary auxiliary nodes:
 * For each group, add an entry node and an exit node.
 *
 * Delete all existing inter-group edges, and replace them with edges on entry and exit nodes.
 * Intra-group edges are retained.
 *
 * Then, do a topological sort on the newly formed nodes.
 *
 * Lastly, remove the temporary nodes from the results.
 */


void test(const int itemCount, const int groupCount, const std::vector<int>& group, const std::vector<std::vector<int>>& beforeItems, const bool haveSolutions) {
    auto solutionInstance = Solution();

    auto result = solutionInstance.sortItems(itemCount, groupCount, group, beforeItems);

    if (haveSolutions) {
        // Check result length.
        if (result.size() != itemCount) {
            std::cout << terminal_format::FAIL << terminal_format::BOLD << "[Wrong] " << terminal_format::ENDC << itemCount << ", " << groupCount << ", " << group << ", " << beforeItems << ": " << result << " (wrong amount of elements)" << std::endl;
            return;
        }

        // Check for the existence of all items.
        for (int i = 0; i < itemCount; i += 1) {
            bool found = false;

            for (int j = 0; j < result.size(); j += 1) {
                if (result[j] == i) {
                    if (found) {
                        // Occurs twice.
                        std::cout << terminal_format::FAIL << terminal_format::BOLD << "[Wrong] " << terminal_format::ENDC << itemCount << ", " << groupCount << ", " << group << ", " << beforeItems << ": " << result << " (item " << i << " appears more than once)" << std::endl;
                        return;
                    } else {
                        found = true;
                    }
                }
            }

            if (!found) {
                std::cout << terminal_format::FAIL << terminal_format::BOLD << "[Wrong] " << terminal_format::ENDC << itemCount << ", " << groupCount << ", " << group << ", " << beforeItems << ": " << result << " (item " << i << " not found)" << std::endl;
                return;
            }
        }

        // Check if elements in the same group are grouped together.
        auto groupElements = std::vector<std::unordered_set<int>>(groupCount, std::unordered_set<int>());
        for (int i = 0; i < itemCount; i += 1) {
            const int currentGroup = group[i];
            if (currentGroup != -1) {
                groupElements[currentGroup].insert(i);
            }
        }

        /*
         * State machine:
         *
         * - `previousGroup` is -1:
         *   - `currentGroup` is -1: Unchanged
         *   - `currentGroup` is not -1: Set `previousGroup` to `currentGroup`
         * - `previousGroup` is not -1:
         *   - `currentGroup` is -1: Are all elements of `previousGroup` visited?
         *     - Yes: Set `previousGroup` to -1
         *     - No: Elements of the same group are not grouped together, `return false`
         *   - `currentGroup` is not -1: Do `previousGroup` and `currentGroup` equal?
         *     - Yes: Remove `currentItem` from `groupElements`
         *     - No: Are all elements of `previousGroup` visited?
         *       - Yes: Set `previousGroup` to `currentGroup`
         *       - No: Elements of the same group are not grouped together, `return false`
         */
        int previousGroup = -1;
        for (const auto& currentItem: result) {
            int currentGroup = group[currentItem];
            if (previousGroup == -1) {
                if (currentGroup != -1) {
                    previousGroup = currentGroup;

                    groupElements[currentGroup].erase(currentItem);
                }
            } else {
                if (currentGroup == -1) {
                    if (groupElements[previousGroup].empty()) {
                        previousGroup = -1;
                    } else {
                        std::cout << terminal_format::FAIL << terminal_format::BOLD << "[Wrong] " << terminal_format::ENDC << itemCount << ", " << groupCount << ", " << group << ", " << beforeItems << ": " << result << " (" << currentItem << " not grouped correctly)" << std::endl;
                        return;
                    }
                } else {
                    if (previousGroup == currentGroup) {
                        groupElements[currentGroup].erase(currentItem);
                    } else {
                        if (groupElements[previousGroup].empty()) {
                            previousGroup = currentGroup;

                            groupElements[currentGroup].erase(currentItem);
                        } else {
                            std::cout << terminal_format::FAIL << terminal_format::BOLD << "[Wrong] " << terminal_format::ENDC << itemCount << ", " << groupCount << ", " << group << ", " << beforeItems << ": " << result << " (" << currentItem << " not grouped correctly)" << std::endl;
                            return;
                        }
                    }
                }
            }
        }

        // Check "before items".
        for (int i = 0; i < itemCount; i += 1) {
            const auto currentBeforeItems = beforeItems[i];
            if (currentBeforeItems.empty()) {
                continue;
            }

            // Find current item in result.
            int currentItemIndex = 0;
            while (result[currentItemIndex] != i) {
                currentItemIndex += 1;
            }

            // Find "before items" in result.
            for (const int& beforeItem: currentBeforeItems) {
                int beforeItemIndex = 0;
                while (result[beforeItemIndex] != beforeItem) {
                    beforeItemIndex += 1;
                }

                if (beforeItemIndex >= currentItemIndex) {
                    std::cout << terminal_format::FAIL << terminal_format::BOLD << "[Wrong] " << terminal_format::ENDC << itemCount << ", " << groupCount << ", " << group << ", " << beforeItems << ": " << result << " ( " << beforeItem << " doesn't come before " << i << ")" << std::endl;
                }
            }
        }

        // The result is OK.
        std::cout << terminal_format::OK_GREEN << "[Correct] " << terminal_format::ENDC << itemCount << ", " << groupCount << ", " << group << ", " << beforeItems << ": " << result << std::endl;
    } else {
        // Don't have a solution. Result must be empty.
        if (result.empty()) {
            std::cout << terminal_format::OK_GREEN << "[Correct] " << terminal_format::ENDC << itemCount << ", " << groupCount << ", " << group << ", " << beforeItems << ": " << "No solution." << std::endl;
        } else {
            std::cout << terminal_format::FAIL << terminal_format::BOLD << "[Correct] " << terminal_format::ENDC << itemCount << ", " << groupCount << ", " << group << ", " << beforeItems << ": " << result << " (should have no solution)" << std::endl;
        }
    }
}


